import axios from 'axios';
import { useEffect } from 'react';
const API_KEY = '43f7b7cce2ae5cabfc5e2f76a4248ec7';
import HeaderItem from './HeaderItem';
const GalleryHeader = ({genreList, setGenreList}) => {
    var request = "";
    var genres = [];
    var sortedGenres = [];
    useEffect(() => {
        request = "https://api.themoviedb.org/3/genre/movie/list?api_key=" + API_KEY + "&language=en-US";
        axios.get(request)
            .then ((response) => {
                console.log(response);
                setGenreList(genreList => []);
                setGenreList(genreList => [...genreList, response.data.genres]);
            })
            .catch(function(error) {
                console.log(error);
            });
    }, []);

    console.log(genreList);
    sortedGenres = genreList;
    genres = sortedGenres.map(item => <HeaderItem key={item.id} genre={item}/>)
    console.log(genres);
    const content = genres

    return (
        //<h1>hello</h1>
         <main>{content}</main>
    );
} 
export default GalleryHeader
